    "after": "Park Avenue, south from 56th Street, where the railroad emerges from the tunnel and the Grand Central Yards begin.\nThe Avenue will be built over the tracks to 52nd Street by 1910 and to the new station by 1913, and the railroad electrified.\nOn west side, note houses between 54th and 53rd Street, which will still be standing thirty years later.\nOn the east side, note old Steinway Piano Factory, dating back to the Civil War or earlier, which will be demolished in 1911.\nBeyond it may be seen the tower of R&M Scheefer's brewery, about the same age, on the S. E. corner of 51st Street where the new St. Bartholomew's Church will be built in 1918.\nCompre with the Edison Company's photograph of the same scene in 1927.\n\nNew York Edison Company Collection.\n\n\nJune 10, 1905.",
    "before": "Park Avenue, south from 55th Street, where the railroad emerges from the tunnel and the Grand Central Yards begin. The Avenue will be built over the tracks to 52nd Street by 1910. On west side, note houses between 54th and 53rd Street, which will still be standing thirty years later. On the west side, note old Steinway Piano Factory, dating back to the Civil War or earlier, which will be demolished in 1911. Beyond it may be seen the tower of F&M Shaefer's brewery, about the same age on the S.E. corner of 51st Street where the new St. Bartholomew's Church will be built in 1918. Compare with Edison Company's photo of the same scene in 1927. June 10, 1905.\n\nNew York's Edison Company Collection.",
