    "after": "163rd Street, (formerly No. 26 Hardenbrook Avenue) east side, north of Jamaica Avenue, showing in a set of two views the Reverend Wm. L. Johnson house, who was the rector of the First Presbyterian Church of Jamaica between 1830 and 1870 when he died. It subsequently became the property of Wm. Hardenbrook who was born in 1810 at Freeport. He settled in Jamaica where he purchased several acres in what is now the business section and opened the thoroughfare upon which this structure stands in 1890. This building originally stood on Jamaica Avenue when same was known as Fulton Street.\n\nEugene L. Armbruster Collection.\n\nMay 1923.\nViews 1, 2",
