    "after": "(1)\n\nSt. Nicholas Ave., north from but not including Fort George Ave. From this point the avenue winds down a sharp hill and reaches Nagle Ave. at its junction with Dyckman Street and Hillside Ave. (where it terminates) This point of vantage affords a panoramic view of the northernmost sector of Manhattan, north from Dyckman Street, to Spuyten Duyvil. At the right is part of Highbridge Park, and at the left is a very steep slope reaching down to Hillside Ave.\n\nP. L. Sperr.\nApril 24, 1937.\n\n(2)\n\nThe same, from a point slightly northward. Also shown is a portion of the Seventh Ave.-Van Cortlandt Line of the Interborough Rapid Transit subway, running, at this point, on an elevated structure on Nagle Ave.\n\nP. L. Sperr.\nApril 20, 1937.\n\n(3)\n\nThe same, but showing a closer view of the point of confluence of the thoroughfares mentioned in view No. 1. At the right appears Dyckman Street as it crosses Nagle Ave. and proceeds northward. The houses seen (left) are on the east side of Dyckman Street, north from Nagle Ave., and also shown (extreme left) is the Dyckman Street station of the subway line (mentioned in view 2).\n\nP. L. Sperr.\nApril 20, 1937.",
    "before": "(1)\nSt. Nicholas Ave., north from but not including Fort George Ave. From this point the avenue winds down a sharp hill and reaches Nagle Ave. at its junction with Dyckman Street and Hillside Ave. (where it terminates) This point of vantage affords a panoramic view of the northernmost sector of Manhattan, north from Dyckman Street, to Spuyten Duyvil. At the right is part of Highbridge Park, and at the left is a very steep slope\nreaching down to Hillside Ave.\nApril 24, 1937.\nP. L. Sperr.\n(2)\nThe same, from a point slightly northward. Also shown is a portion of the Seventh Ave.-Van Cortlandt Line of the Interborough Rapid Transit subway, running, at this point, on an elevated structure on Nagle Ave.\nApril 20, 1937.\nP. L. Sperr.\n(3)\nThe same, but showing a closer view of the point of confluence of the thoroughfares mentioned in view No. 1. At the right appears Dyckman Street as it crosses Nagle Ave. and proceeds northward. The houses seen (left) are on the east side of Dyckman Street, north from Nagle Ave., and (right) on the north side of the latter, east from the former street. Also shown (extreme left) is the Dyckman Street station of the subway\nline (mentioned in view 2).\nApril 20, 1937.\nP. L. Sperr.\n",
