    "after": "CONSTRUCTION ON NEW YORK'S GREAT CATHEDRAL TO BE RESUMED SOON\n\nNew photo of the Protestant Episcopal Cathedral of Saint John the Divine, on which construction is to be resumed soon. This photo shows the apse or East end, with seven radiating chapels; and the crossing, with its temporary dome. The nave, or staff of the cross, which the completed church will form, is the next part to be built. It is also planned to erect a great tower, 500 feet high, above the present, temporary, dome. March 10, 1924 Underwood and Underwood\n\nEven in its unfinished condition the Cathedral represents an expenditure of more than $5,000,000 and when completed will have cost four times as much. There will be seats for 7,000 persons. Some of the seven chapels are as commodious as many churches. It is expected that the Cathedral will be completed within ten years.\nReview of Reviews\n\nNeg. # Z601",
    "before": "Construction on New York's great cathedral to be resumed soon.\n\nNew photo of the Protestant Episcopal Cathedral of Saint John the Divine, on which construction is to be resumed soon. This photo shows the apse, or East end, with seven radiating chapels; and the crossing, with its temporary dome.\n\nThe nave, or staff of the cross, which this completed church will form, is the next part to be built. It is also planned to erect a great tower, 500 feet high, above the present, temporary dome.\n\nMarch 10, 1924  Underwood and Underwood\n\nEven in its unfinished condition the Cathedral represents an expenditure of more than $5,000,000 and when completed will have cost four times as much. There will be seats for 7,000 persons. Some of the seven chapels are as commodious as many churches. It is expected that the Cathedral will be completed within ten years.\n\nReview of Reviews\n",
