    "after": "(1)\nJefferson Market Courthouse and clock tower, with the excavation on the site of the old jail and the law and bail bond offices on the north side of 10th Street (formerly Amos Street), from\nGreenwich Avenue to Sixth Avenue.\nThe courthouse, on the S.W. corner of Sixth Avenue and 10th Street, was erected in 1875. Prior to that there was a tall, roundish wooden tower, rather like a lighthouse in appearance, on the same site. The new House of Detention for Women is to be built in 1930-31, to fill the rest of the triangular block in which\nthe courthouse stands.\nThe break in the north side of 10th Street is the entrance to\nPatchin Place, a semi-private residential court.\nP. L. Sperr.\n\n(2)\nThe same, showing only the N.E. corner at Greenwich Avenue and the south side to Sixth Avenue, three years later, with the new House of Detention for Women on the site of the old jail.\nP. L. Sperr.",
