    "after": "Union Square East (normally 4th Avenue) at E. 17th Street as photographed northeastward from various points. No. 1 is from the diagonal far corner of the Square, at Broadway and 14th Street; No. 2 from atop an office structure on the same street and No. 3 from inside the Park. Occupying the various corners at this point are, the Everett Building, the Guardian Life Insurance Co. Building and Tammany Hall. Incidentally, Fourth Avenue, officially starts there and that portion bordering the Square is identified by same.\n\nThe Lincoln statue appears in the earlier view. This is at the Broadway point, popularly known as \"Death Curve.\" This arose from the danger to pedestrians from the speeding Broadway streetcars on their turn into 14th Street from Union Square West.\n\nView 1: February 12, 1928\nView 2: August 4, 1930\nView 3: February 24, 1933\n\nP. L. Sperr",
