    "after": "Minetta Street (left), at the S. W. corner of Minetta Lane (right) and southward, showing a preparatory stage for a new 6-story apartment house on this site. Thru the clearance appear buildings that are across 6th Avenue. Predominant is the new Roman Catholic Church of Our Lady of Pompeii. This is at the N. W. corner of Carmine and Bleecker Streets.\nNote the bend in Minetta Street and the isolated structures remaining on its west side. These are No's 12 and 14. Another apartment house is to be erected to abut on the far side of same as per the N. Y. Times of September 9, 1940. This site was formerly occupied by several frame buildings with brick fronts. At their rears was an inner court, Minetta Place. On the extension of 6th Avenue this and its rear buildings were exposed to view and subsequently obliterated.\n\nApril 13, 1940\nViews 1,2\n\nP. L. Sperr",
